from typing import List
import random
class Solution:
    def sortArray(self, nums: List[int]) -> List[int]:
    
        def qs(i,j):
            #print("in:", i,j,nums)
            if i>=j: return
            
            #select a random pivot and put it at least position
            i_pivot=random.randint(i,j)
            nums[j],nums[i_pivot]=nums[i_pivot],nums[j]

            pivot=nums[j]
            lastidx=i
            for idx in range(i,j):
                if nums[idx]<pivot:
                    nums[idx],nums[lastidx]=nums[lastidx],nums[idx]
                    lastidx+=1
            nums[j],nums[lastidx]=nums[lastidx],nums[j]
            qs(i,lastidx-1)
            while lastidx<j and nums[lastidx]==pivot:
                lastidx+=1
            if lastidx<j:
                qs(lastidx,j)
            #print("out:", i,j,nums)

        qs(0,len(nums)-1)
        return nums
                

        
